import '../../components/headerLogin/HeaderLogin'; // Importação correta do HeaderLogin
import '../../components/auth/Login'; // Importação correta do Login
import '../../components/menu/Menu'; // Importação correta do Menu
import '../home/Home'; // Importação correta do Home
import React, { useState, useEffect } from 'react'; // Corrigi a importação de useEffect
import './CreateUser.css';
import { createUser, fetchUsers } from '../../services/userService'; // Certifique-se de que fetchUsers está implementado no userService
import { toast, ToastContainer } from 'react-toastify';  
import 'react-toastify/dist/ReactToastify.css';  

function CreateUserComponent() {
    const [user, setUser] = useState({
        nome: '',
        email: '',
        password: '',
        permission_id: '1',
    });
    const [users, setUsers] = useState([]);
    const [errorMessage, setErrorMessage] = useState('');

    // Carregar a lista de usuários ao carregar o componente
    useEffect(() => {
        const loadUsers = async () => {
            try {
                const usersData = await fetchUsers(); // Chama a função fetchUsers corretamente
                setUsers(usersData); // Atualiza o estado com a lista de usuários
            } catch (err) {
                setErrorMessage('Erro ao buscar usuários: ' + err.message);
            }
        };
        loadUsers();
    }, []);

    // Lida com a mudança nos campos de input
    const handleChange = (e) => {
        setUser({ ...user, [e.target.name]: e.target.value });
    };

    // Lida com o envio do formulário
    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await createUser(user); // Chama a função de criação de usuário
            setUser({ nome: '', email: '', password: '', permission_id: '1' }); // Limpa os campos do formulário
            toast.success('Usuário criado com sucesso!');
            const usersData = await fetchUsers(); // Atualiza a lista de usuários após a criação de um novo usuário
            setUsers(usersData);
        } catch (error) {
            const errMsg = error.message || 'Erro ao criar usuário.';
            setErrorMessage(errMsg);
            toast.error(errMsg);
        }
    };

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Nome:</label>
                    <input type="text" name="nome" value={user.nome} onChange={handleChange} required />
                </div>
                <div>
                    <label>Email:</label>
                    <input type="email" name="email" value={user.email} onChange={handleChange} required />
                </div>
                <div>
                    <label>Senha:</label>
                    <input type="password" name="password" value={user.password} onChange={handleChange} required />
                </div>
                <button type="submit">Criar Usuário</button>
            </form>

            <ToastContainer />
            {errorMessage && <div style={{ color: 'red' }}>{errorMessage}</div>}

            <h2>Lista de Usuários</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Email</th>
                        <th>Permissão</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.nome}</td>
                            <td>{user.email}</td>
                            <td>{user.permission_id === '1' ? 'Total' : 'Limitada'}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default CreateUserComponent;
